import React, { Component } from 'react';
import logo from '../newspoint.png';
import NewsItem from './NewsItem';
export default class NewsComponents extends Component {
  render() {
    return (
        <div className="container my-3">
            <h1 className='mainHeading my-2 mb-4'><img src={logo} style={{width:"80px"}} alt="" /> - Read Latest Political, Sports, Entertainment News</h1>
            <div className="row">
                <div className="col mt-3">
                    <NewsItem/>
                </div>
            </div>
        </div>
    )
  }
}
